import './App.css';

import List from "./List";
function App() {
  const list = [{peru: "infinity", age: 17}, {peru: "kavasiki", age: 19}];
  return (
    <div>
      {list.map((value, key) => {
        return <h1 align = "center">{value}</h1>
      })}
    </div>
  );
}

export default App;
